create database blinkitdb;

use blinkitdb;

CREATE TABLE `Orders` (
  `OrderID` BIGINT,
  `CustomerID` BIGINT,
  `OrderDateTime` DATETIME,
  `DeliveryDateTime` DATETIME NULL,
  `TotalAmount` BIGINT,
  `DeliveryStatus` VARCHAR(1024)
);



CREATE TABLE `customers` (
  `CustomerID` BIGINT,
  `Name` VARCHAR(1024),
  `Phone` BIGINT,
  `Address` VARCHAR(1024),
  `City` VARCHAR(1024)
);


CREATE TABLE `order_details` (
  `OrderDetailsID` BIGINT,
  `OrderID` BIGINT,
  `ProductName` VARCHAR(1024),
  `Quantity` BIGINT,
  `PricePerUnit` BIGINT
);



